import React from 'react';
import './play.css';
import '../homeComponents/home.css';
import UnderLine from '../homeComponents/underLine';


const DynamicGameArea = (props) => {
    return(
        <div className={'gameArea'}>
            <p className={'play-start-text'}>You are ready to go</p>
            <UnderLine className={'start-underLine'} />
            <div className={'button start-button'}>Start Game</div>
        </div>
    );
};

export default DynamicGameArea;
